import React from 'react';

class CharacterList extends React.Component{
    render(){
        const array=this.props.character;
        array.map((array) => <li>{array}</li>)
        return(
            <div className="col-md-4">
                <ul>{array}</ul>
            </div>
        );
    }
}

export default CharacterList;
